    const CustomInput = forwardRef(({ value, onClick }, ref) => (
        <input className="model-input" onClick={onClick} ref={ref}>
          {value}
        </input>
      ));
    return (
      <DatePicker
        selected={new Date()}
        // renderMonthContent={renderMonthContent}
